INSERT INTO tx_mediaoembed_provider VALUES ('45', '0', '1304768769', '1303850463', '0', 'The Daily Show', 'thedailyshow', '0', '0', 'The Daily Show is an Emmy and Peabody Award-winning program that takes a reality-based look at news, trends, pop culture, current events, politics, sports and entertainment with an alternative point of view. In each show, anchorman Jon Stewart and a team of correspondents, including Aasif Mandvi, Wyatt Cenac, John Oliver, Jason Jones and Samantha Bee, comment on the day\'s stories, employing actual news footage, taped field pieces, in-studio guests and on-the-spot coverage of important news events.', '0', 'http://www.thedailyshow.com/watch/*\r\nhttp://www.thedailyshow.com/full-episodes/*\r\nhttp://www.thedailyshow.com/collection/*/*/*\r\nhttp://*.thedailyshow.com/video/*', '12288', '', '1', '0', NULL, '1,220');
